  }

  render() {

    return (
      <div className="KnobBoxTop">

      <div className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn Reacttttt
        </a>
      </div>

      </div>
    )
  }

}

export default Knob2;
